function Home() {
  useEffect(() => {
    if (navigator.connection && !!navigator.connection.effectiveType) {
      console.log(navigator.connection.effectiveType);
      if (navigator.connection.effectiveType === "4g") {
       console.log('Estamos en una red 4g');
      }
    }
  }, []);


  return (
    <Fragment>
      <div className="center">
        <SearchInput />
      </div>
      <CardsDrags />
      <Cards />
      <br />
      <br />
      <br />
      <br />
      <br />
    </Fragment>
  );
}

export default Home;
